    /**
     * 滑动窗口
     * 弃用split分隔方法，使用charAt方法提升效率。
     * @param s
     * @return
     */
    public int lengthOfLongestSubstring(String s) {
        //处理特殊情况
        if(s.length() == 0){
            return 0;
        }
        //声明一个结果值
        int result = 0;
        //声明一个Set集合
        Set<Character> set = new HashSet<Character>();
        int l = 0;
        for (int r = 0; r < s.length(); r++) {
            Character si = s.charAt(r);
            if(set.contains(si)){
                int z = l;
                while (true){
                    if(l < r && s.charAt(l++) == s.charAt(r)){
                        break;
                    }else if(l >= r){
                        l = z;
                        break;
                    }
                }
            }
            if(r - l + 1 > result){
                result = r - l + 1;
            }
            set.add(si);
        }
        return result;
    }

    /**
     * 这个方法在LeetCode提交超时，本地执行特别慢，思路是对的，就是太慢，不推荐。
     * @param s
     * @return
     */
    public int lengthOfLongestSubstring2(String s) {
        if(s.length() == 0){
            return 0;
        }
        int result = 1;
        //声明一个Set集合
        Set<String> set = new HashSet<>();
        //分隔字符串
        String[] strings = s.split("");
        for (int i = strings.length; i > 0 && i > result; i--) {
            for (int j = strings.length - i; j < strings.length; j++) {
                String string = strings[j];
                if(set.contains(string)){
                    set.clear();
                    set.add(string);
                }else{
                    set.add(string);
                    if(set.size() > result){
                        result = set.size();
                    }
                }
            }
            set.clear();
        }
        return result;
    }

